import React, { Component, Fragment } from 'react';
import { connect } from 'react-redux';
import { loadAllSurvey } from '../../action/survey';
//import { Card, Icon, Image } from 'semantic-ui-react';

class NotFInsh extends Component {
  componentDidMount = () => {
    loadAllSurvey();
  };
  render() {
    return (
      <Fragment>
        <div className='ui card'>
          <div className='image'>
            <img src='https://react.semantic-ui.com/images/avatar/large/matthew.png' />
          </div>
          <div className='content'>
            <div className='header'>Matthew</div>
            <div className='meta'>
              <span className='date'>Joined in 2015</span>
            </div>
            <div className='description'>
              Matthew is a musician living in Nashville.
            </div>
          </div>
          <div className='extra content'>
            <a>
              <i aria-hidden='true' className='user icon'></i>
              22 Friends
            </a>
          </div>
        </div>
      </Fragment>
    );
  }
}

export default connect(null, { loadAllSurvey })(NotFInsh);
